import React, { Component } from 'react';
import {
    OwpButton,
    OwpSearchDateTimePickerMulti,
    OwpPageCarded,
    OwpSearchHeader,
    OwpSearchSelectField,
    OwpSearchTextField,
    OwpToolbar,
    OwpTreeGrid,
    OwpSearchAutoComplete,
    OwpDateTimePicker,
} from 'owp/wrapper';
import * as TGEvent from 'owp/TGEvent';
import Pop_C0803001 from '../../include/Pop_C0803001';

class Page extends Component {
    constructor(props) {
        super(props);
        this.state = {};
    }


    render() {
        return (
            <React.Fragment>
                <OwpPageCarded
                    header={
                        <OwpSearchHeader url="listOwpProdplan">
                            <div className="w-full">
                                <div className="flex mb-16">
                                    <OwpDateTimePicker
                                        initNow
                                        label="연도"
                                        inputProps={{ style: { width: '160px', marginRight:'20px'}}}
                                    />

                                    <OwpSearchSelectField
                                        className="w-160"
                                        id={'sm05'}
                                        name={'sm05'}
                                        label="설비등급"
                                        options={[
                                            { label: 'S', value: '1' },
                                            { label: 'A', value: '2' },
                                        ]}
                                        value={'1'}
                                    />
                                    <OwpSearchAutoComplete
                                        className="w-160"
                                        id={'sm01'}
                                        name={'sm01'}
                                        label={'Location'}
                                        
                                    />
                                    <OwpSearchSelectField
                                        className="w-160"
                                        id={'sm05'}
                                        name={'sm05'}
                                        label="조회일자 유형"
                                        options={[
                                            { label: '주', value: '1' },
                                            { label: '월', value: '2' },
                                        ]}
                                        value={'1'}
                                    />
                                    <OwpSearchAutoComplete
                                        className="w-160"
                                        id={'sm03'}
                                        name={'sm03'}
                                        label={'Equipment Name'}
                                        
                                    />
                                    <OwpSearchAutoComplete
                                        className="w-160"
                                        id={'sm03'}
                                        name={'sm03'}
                                        label={'REMARKS'}
                                        
                                    />
                                    <OwpSearchAutoComplete
                                        className="w-160"
                                        id={'sm03'}
                                        name={'sm03'}
                                        label={'ID No.'}
                                        
                                    />
                                </div>
                                <div className="flex">
                                    <OwpSearchAutoComplete
                                        className="w-160"
                                        id={'sm03'}
                                        name={'sm03'}
                                        label={'구분'}
                                        
                                    />
                                    <OwpSearchAutoComplete
                                        className="w-160"
                                        id={'sm03'}
                                        name={'sm03'}
                                        label={'점검주기'}
                                        
                                    />
                                </div>
                            </div>
                        </OwpSearchHeader>
                    }
                    contentToolbar={
                        <OwpToolbar title="예방점검 스케줄">
                            <Pop_C0803001/>
                        </OwpToolbar>
                    }
                    content={
                        <React.Fragment>
                            <OwpTreeGrid
                                id="C0803000"
                                LayoutUrl={'/assets/data/C0803000Def.xml'}
                                DataUrl={'/assets/data/C0202000Data.xml'}
                            />
                        </React.Fragment>
                    }
                    innerScroll
                />
            </React.Fragment>
        );
    }
}

export default Page;
